import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import Header from './components/Header';
import Footer from './components/Footer';
import HistorialCitas from './components/HistorialCitas';
import ProgramacionCitas from './components/ProgramacionCitas';
import RegistroPaciente from './components/RegistroPaciente';
import RegistroMedico from './components/RegistroMedico';
import LoginModal from './components/LoginModal';
import RegisterModal from './components/RegisterModal';
import './styles.css';

const App = () => {
  const [showLoginModal, setShowLoginModal] = useState(false);
  const [showRegisterModal, setShowRegisterModal] = useState(false);

  return (
    <Router>
      <div className="d-flex flex-column min-vh-100">
        {/* Navbar superior con Bootstrap */}
        <nav className="navbar navbar-expand-lg navbar-dark bg-primary sticky-top">
          <div className="container-fluid">
            <Link className="navbar-brand" to="/">Sistema de Citas Médicas</Link>
            <button 
              className="navbar-toggler" 
              type="button" 
              data-bs-toggle="collapse" 
              data-bs-target="#navbarNav"
            >
              <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarNav">
              <ul className="navbar-nav me-auto">
                <li className="nav-item">
                  <Link className="nav-link" to="/registro-paciente">Registro de Paciente</Link>
                </li>
                <li className="nav-item">
                  <Link className="nav-link" to="/registro-medico">Registro de Médico</Link>
                </li>
                <li className="nav-item">
                  <Link className="nav-link" to="/historial">Historial de Citas</Link>
                </li>
                <li className="nav-item">
                  <Link className="nav-link" to="/programacion">Programación de Citas</Link>
                </li>
              </ul>
              <div className="d-flex">
                <button 
                  className="btn btn-light me-2" 
                  onClick={() => setShowLoginModal(true)}
                >
                  Iniciar Sesión
                </button>
                <button 
                  className="btn btn-outline-light" 
                  onClick={() => setShowRegisterModal(true)}
                >
                  Registrarse
                </button>
              </div>
            </div>
          </div>
        </nav>

        {/* Contenido principal con margen para el navbar fijo */}
        <main className="flex-grow-1" style={{ paddingTop: '80px' }}>
          <Routes>
            <Route
              path="/"
              element={
                <div className="hero-banner" style={{ backgroundImage: `url(${process.env.PUBLIC_URL + '/hero-banner.jpg'})` }}>
                  <div className="banner-content">
                    <h2>Bienvenido al Sistema de Citas Médicas</h2>
                    <div className="buttons">
                      <button className="btn btn-primary me-2" onClick={() => setShowLoginModal(true)}>Iniciar Sesión</button>
                      <button className="btn btn-success" onClick={() => setShowRegisterModal(true)}>Registrarse</button>
                    </div>
                  </div>
                </div>
              }
            />
            <Route path="/historial" element={<HistorialCitas />} />
            <Route path="/programacion" element={<ProgramacionCitas />} />
            <Route path="/registro-paciente" element={<RegistroPaciente />} />
            <Route path="/registro-medico" element={<RegistroMedico />} />
          </Routes>
        </main>

        {/* Modales */}
        <LoginModal show={showLoginModal} onHide={() => setShowLoginModal(false)} />
        <RegisterModal
          show={showRegisterModal}
          onHide={() => setShowRegisterModal(false)}
          onPatientRegister={() => window.location.href = '/registro-paciente'}
          onDoctorRegister={() => window.location.href = '/registro-medico'}
        />

        {/* Footer */}
        <Footer className="mt-auto" />
      </div>
    </Router>
  );
};

export default App;
